/*Table structure for table `order` */

DROP TABLE IF EXISTS `order`;

CREATE TABLE `order` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'id,主键',
  `store_id` int(10) unsigned NOT NULL COMMENT '门店编号',
  `merchant_id` int(11) NOT NULL COMMENT '商户id',
  `user_id` int(11) NOT NULL COMMENT '操作员id,为0代表是固定收款码的订单',
  `order_no` varchar(64) NOT NULL COMMENT '商户单号,自己的单号',
  `third_order_no` varchar(64) DEFAULT NULL COMMENT '第三方单号，支付宝或微信单号',
  `total_amount` decimal(9,2) NOT NULL DEFAULT '0.00' COMMENT '订单金额，单位元',
  `refund_amount` decimal(9,2) NOT NULL DEFAULT '0.00' COMMENT '退款总金额',
  `refund_status` tinyint(4) NOT NULL COMMENT '10：无退款，20：部分退款，30：全额退款,40:退款处理中,50:退款失败',
  `pay_type` varchar(20) DEFAULT NULL COMMENT '支付类型，alipay-支付宝，wxpay-微信支付',
  `pay_amount` decimal(9,2) NOT NULL DEFAULT '0.00' COMMENT '用户实际支付金额',
  `create_time` int(11) NOT NULL COMMENT '订单生成时间',
  `received_amount` decimal(9,2) NOT NULL DEFAULT '0.00' COMMENT '实收金额',
  `trade_status` tinyint(4) NOT NULL COMMENT '10-待支付，20-支付成功，30-订单取消,40-支付失败',
  `pay_time` int(11) DEFAULT NULL COMMENT '支付时间',
  `buyer_id` varchar(128) DEFAULT NULL COMMENT '用户唯一标识，支付宝是pid，微信是open_id',
  `buyer_name` varchar(64) DEFAULT NULL COMMENT '用户账号，支付宝是可以拿到一部分，微信还不行',
  `buyer_nickname` varchar(64) DEFAULT NULL COMMENT '用户昵称，只针对微信',
  `order_subject` varchar(255) DEFAULT NULL COMMENT '订单主题',
  `pay_method` varchar(20) DEFAULT NULL COMMENT '支付方法，bar-条码,qr-动态二维码,wap-网页固定二维码',
  PRIMARY KEY (`id`),
  KEY `store_id` (`store_id`),
  KEY `merchant_id` (`merchant_id`),
  KEY `user_id` (`user_id`),
  KEY `order_no` (`order_no`),
  KEY `refund_status` (`refund_status`),
  KEY `pay_type` (`pay_type`),
  KEY `create_time` (`create_time`),
  KEY `trade_status` (`trade_status`),
  KEY `buyer_id` (`buyer_id`)
