/*Table structure for table `order_bill` */

DROP TABLE IF EXISTS `order_bill`;

CREATE TABLE `order_bill` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `merchant_id` int(11) NOT NULL COMMENT '商户id',
  `store_id` int(11) NOT NULL COMMENT '店铺id',
  `bill_date` int(11) NOT NULL COMMENT '账单日期，20160820',
  `bill_month` int(11) NOT NULL COMMENT '账单月，8',
  `bill_week` int(11) NOT NULL COMMENT '账单周，0-星期日',
  `total_trade_amount` decimal(10,2) NOT NULL COMMENT '总交易金额,元',
  `total_refund_amount` decimal(10,2) NOT NULL COMMENT '总退款金额，元',
  `create_time` int(11) NOT NULL COMMENT '创建时间戳',
  PRIMARY KEY (`id`),
  KEY `merchant_id` (`merchant_id`),
  KEY `store_id` (`store_id`),
  KEY `bill_date` (`bill_date`)
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8 COMMENT='账单表';

