/*Table structure for table `order_flow` */

DROP TABLE IF EXISTS `order_flow`;

CREATE TABLE `order_flow` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `user_id` int(11) NOT NULL COMMENT '用户id',
  `store_id` int(11) NOT NULL COMMENT '店铺id',
  `merchant_id` int(11) NOT NULL COMMENT '商户id',
  `order_id` int(11) NOT NULL COMMENT '订单id',
  `order_no` varchar(64) NOT NULL COMMENT '订单号',
  `flow_amount` decimal(10,2) NOT NULL COMMENT '流水金额',
  `flow_status` tinyint(4) NOT NULL DEFAULT '10' COMMENT '流水状态，10-收入，20-支出,30-退款处理中',
  `pay_type` varchar(20) NOT NULL COMMENT '付款方式，alpay-支付宝，wxpay-微信',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_id` (`order_id`,`flow_status`),
  KEY `user_id` (`user_id`),
  KEY `store_id` (`store_id`),
  KEY `merchant_id` (`merchant_id`),
  KEY `order_id_2` (`order_id`),
  KEY `flow_status` (`flow_status`),
  KEY `pay_type` (`pay_type`),
  KEY `create_time` (`create_time`)
) ENGINE=InnoDB AUTO_INCREMENT=377 DEFAULT CHARSET=utf8 COMMENT='订单流水表，只有资金发生变化时才记录，只能新增，不可修改';

