/*Table structure for table `order_pay` */

DROP TABLE IF EXISTS `order_pay`;

CREATE TABLE `order_pay` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_no` varchar(64) NOT NULL COMMENT '支付商户单号',
  `third_order_no` varchar(64) DEFAULT NULL COMMENT '第三方单号',
  `api_pay_state` tinyint(4) NOT NULL DEFAULT '10' COMMENT '10默认未收到通知20已收到通知(只有第三方支付接口通知到时才会更改此状态)',
  `api_desc` text COMMENT 'api的接口返回详情',
  PRIMARY KEY (`id`),
  KEY `order_no` (`order_no`),
  KEY `third_order_no` (`third_order_no`),
  KEY `api_pay_state` (`api_pay_state`)
) ENGINE=InnoDB AUTO_INCREMENT=1221 DEFAULT CHARSET=utf8 COMMENT='订单支付表';

