/*Table structure for table `order_refund` */

DROP TABLE IF EXISTS `order_refund`;

CREATE TABLE `order_refund` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `order_id` int(11) NOT NULL COMMENT '订单id',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `refund_no` varchar(64) NOT NULL COMMENT '退款单号',
  `refund_amount` decimal(9,2) NOT NULL COMMENT '退款金额',
  `refund_state` tinyint(4) NOT NULL DEFAULT '10' COMMENT '退款状态，10-退款中，20-退款成功，30-退款失败',
  `refund_reason` varchar(255) DEFAULT NULL COMMENT '退款原因',
  `api_desc` text NOT NULL COMMENT '退款api返回json数据',
  `refund_time` int(11) NOT NULL DEFAULT '0' COMMENT '退款接受时间戳',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`),
  KEY `create_time` (`create_time`),
  KEY `refund_no` (`refund_no`),
  KEY `refund_state` (`refund_state`)
) ENGINE=InnoDB AUTO_INCREMENT=369 DEFAULT CHARSET=utf8 COMMENT='订单退款表';

