/*Table structure for table `root` */

DROP TABLE IF EXISTS `root`;

CREATE TABLE `root` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `root_name` varchar(20) NOT NULL,
  `root_pwd` char(32) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `root_name` (`root_name`),
  KEY `root_pwd` (`root_pwd`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='超级管理员表';

/*Data for the table `root` */

