/*Table structure for table `self_update` */

DROP TABLE IF EXISTS `self_update`;

CREATE TABLE `self_update` (
  `name` varchar(11) NOT NULL COMMENT '主键，major-代表主要包',
  `is_use` tinyint(4) NOT NULL DEFAULT '10' COMMENT '是否使用，10-暂停使用；20-可以使用',
  `bsize` int(11) NOT NULL COMMENT '软件大小b',
  `vercode` int(11) NOT NULL COMMENT '系统版本号，数字',
  `version` varchar(100) NOT NULL COMMENT '用户版本号，字符串',
  `certmd5` char(32) NOT NULL COMMENT '包签名',
  `update_desc` text COMMENT '更细说明',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  `package` varchar(100) NOT NULL COMMENT '包名',
  `apk_path` varchar(255) NOT NULL COMMENT '下载地址路径,需要自行拼接域名',
  `apk_filename` varchar(64) NOT NULL COMMENT 'apk文件名',
  `update_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1普通更新，2强制更新',
  PRIMARY KEY (`name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `self_update` */

insert  into `self_update`(`name`,`is_use`,`bsize`,`vercode`,`version`,`certmd5`,`update_desc`,`update_time`,`package`,`apk_path`,`apk_filename`,`update_type`) values ('major',20,1232142141,2,'2.0.3','4131543523445252425','1.A功能出来\n2.B功能\n3.C功能',0,'4231234152','/Public/Uploads/Update/2.0.apk','2.0.apk',1);

/*Table structure for table `store` */

DROP TABLE IF EXISTS `store`;

CREATE TABLE `store` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `store_name` varchar(32) NOT NULL COMMENT '店铺名',
  `merchant_id` int(11) NOT NULL COMMENT '商户id',
  `alipay_store_id` varchar(128) DEFAULT NULL COMMENT '支付宝店铺id',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `update_time` int(11) NOT NULL COMMENT '修改时间',
  `api_desc` text COMMENT '支付宝api返回，json格式',
  `store_id` varchar(32) DEFAULT NULL COMMENT '外部门店编号；最长32位字符，该编号将作为收单接口的入参， 请开发者自行确保其唯一性。',
  `category_id` varchar(32) DEFAULT NULL COMMENT '类目id，请参考商户入驻要求。',
  `brand_name` varchar(32) DEFAULT NULL COMMENT '品牌名，不填写则默认为“其它品牌”。',
  `brand_logo` varchar(255) DEFAULT NULL COMMENT '品牌LOGO; 图片ID，不填写则默认为门店首图main_image。',
  `brand_logo_id` varchar(64) DEFAULT NULL COMMENT '品牌logo支付宝id',
  `main_shop_name` varchar(20) DEFAULT NULL COMMENT '主门店名 比如：肯德基；主店名里不要包含分店名，如“万塘路店”。主店名长度不能超过20个字符。',
  `branch_shop_name` varchar(20) DEFAULT NULL COMMENT '分店名称，比如：万塘路店，与主门店名合并在客户端显示为：肯德基(万塘路店)。',
  `province_code` varchar(10) DEFAULT NULL COMMENT '省份编码，国标码，详见国家统计局数据',
  `city_code` varbinary(10) DEFAULT NULL COMMENT '城市编码，国标码，详见国家统计局数据',
  `district_code` varchar(10) DEFAULT NULL COMMENT '区县编码，国标码，详见国家统计局数据',
  `address` varchar(50) DEFAULT NULL COMMENT '门店详细地址，地址字符长度在4-50个字符，注：不含省市区。门店详细地址按规范格式填写地址，以免影响门店搜索及活动报名：例1：道路+门牌号，“人民东路18号”；例2：道路+门牌号+标志性建筑+楼层，“四川北路1552号欢乐广场1楼”。',
  `longitude` varchar(15) DEFAULT NULL COMMENT '经度；最长15位字符（包括小数点）， 注：高德坐标系。经纬度是门店搜索和活动推荐的重要参数，录入时请确保经纬度参数准确。',
  `latitude` varchar(15) DEFAULT NULL COMMENT '纬度；最长15位字符（包括小数点）， 注：高德坐标系。经纬度是门店搜索和活动推荐的重要参数，录入时请确保经纬度参数准确',
  `contact_number` varchar(64) DEFAULT NULL COMMENT '门店电话号码；支持座机和手机，只支持数字和+-号，在客户端对用户展现， 支持多个电话， 以英文逗号分隔。',
  `notify_mobile` varchar(20) DEFAULT NULL COMMENT '门店店长电话号码；用于接收门店状态变更通知，收款成功通知等通知消息， 不在客户端展示。',
  `main_image` varchar(512) DEFAULT NULL COMMENT '门店首图，非常重要，推荐尺寸2000*1500。',
  `main_image_id` varchar(512) DEFAULT NULL COMMENT '门店首图支付宝id',
  `audit_images` varchar(255) DEFAULT NULL COMMENT '门店审核时需要的图片；至少包含一张门头照片，两张内景照片，必须反映真实的门店情况，审核才能够通过；多个图片之间以英文逗号分隔。',
  `audit_images_id` varchar(255) DEFAULT NULL COMMENT '审核图片支付宝id',
  `isv_uid` varchar(16) DEFAULT NULL COMMENT 'ISV返佣id，门店创建、或者门店交易的返佣将通过此账号反给ISV，如果有口碑签订了返佣协议，则该字段作为返佣数据提取的依据。此字段必须是个合法uid，2088开头的16位支付宝会员账号，如果传入错误将无法创建门店。',
  `licence` varchar(255) DEFAULT NULL COMMENT '门店营业执照图片',
  `licence_id` varchar(64) DEFAULT NULL COMMENT '营业执照支付宝id',
  `licence_name` varchar(64) DEFAULT NULL COMMENT '营业执照名称',
  `licence_code` varchar(255) DEFAULT NULL COMMENT '门店营业执照编号',
  `business_certificate` varchar(64) DEFAULT NULL COMMENT '许可证，各行业所需的证照资质参见商户入驻要求；',
  `business_certificate_id` varchar(64) DEFAULT NULL COMMENT '许可证支付宝id',
  `auth_letter` varchar(255) DEFAULT NULL COMMENT '门店授权函,营业执照与签约账号主体不一致时需要。',
  `auth_letter_id` varchar(64) DEFAULT NULL COMMENT '授权函支付宝id',
  `other_authorization` varchar(512) DEFAULT NULL COMMENT '其他资质照片，逗号分开',
  `other_authorization_id` varchar(512) DEFAULT NULL COMMENT '其他资质照片阿里图片id，逗号分开',
  `request_id` varchar(64) DEFAULT NULL COMMENT '支持英文字母和数字，由开发者自行定义（不允许重复），在门店notify消息中也会带有该参数，以此标明本次notify消息是对哪个请求的回应。',
  `audit_status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '本系统状态。1-未审核，2-提交审核，3-审核通过，4-审核变动需重新提交',
  PRIMARY KEY (`id`),
  KEY `merchant_id` (`merchant_id`),
  KEY `create_time` (`create_time`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;

