/*Table structure for table `store_api` */

DROP TABLE IF EXISTS `store_api`;

CREATE TABLE `store_api` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `store_id` int(11) DEFAULT NULL,
  `apply_id` varchar(64) DEFAULT NULL COMMENT '支付宝相应序号',
  `request_id` varchar(64) DEFAULT NULL COMMENT '提交支付宝请求序号',
  `audit_status` varchar(20) DEFAULT NULL COMMENT '门店审核状态，对于开发者而言，只有三个状态。AUDITING：审核中,AUDIT_FAILED：审核驳回,AUDIT_SUCCESS：审核通过,第一次审核通过会触发门店上架',
  `result_desc` text COMMENT '审核失败的描述',
  `api_status` tinyint(4) NOT NULL DEFAULT '10' COMMENT 'api接受状态，10-未收到，20-已收到',
  `create_time` int(11) DEFAULT NULL COMMENT '创建时间',
  `update_time` int(11) DEFAULT NULL,
  `api_desc` text COMMENT 'api接口返回记录',
  PRIMARY KEY (`id`),
  KEY `store_id` (`store_id`),
  KEY `apply_id` (`apply_id`),
  KEY `api_status` (`api_status`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='支付宝店铺api调用记录表';

