/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `user_name` varchar(32) NOT NULL DEFAULT '' COMMENT '用户登陆名',
  `user_pwd` char(32) NOT NULL DEFAULT '' COMMENT '密码',
  `user_pickname` varchar(32) NOT NULL COMMENT '用户昵称',
  `last_login_time` int(11) DEFAULT '0' COMMENT '上次登录时间',
  `last_ip` varchar(15) DEFAULT NULL COMMENT '上次登录ip',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '修改时间',
  `merchant_id` int(11) NOT NULL DEFAULT '0' COMMENT '商户id',
  `store_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户所属店铺id，如果用户是商户主，则为0',
  `user_role` varchar(20) NOT NULL DEFAULT '' COMMENT '用户角色，operator-操作员，accountant－财务，boss－商铺老板',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_name` (`user_name`),
  KEY `merchant_id` (`merchant_id`),
  KEY `store_id` (`store_id`),
  KEY `user_role` (`user_role`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8;

